import { Navlink } from "react-router-dom";
import styles from "./Navbar.module.css";
import CurrencySelector from "./CurrencySelector";

function Navbar({ isLoggedin, setisLoggedin, currency, updateCurrency }) {
  return (
    <nav className={styles.nav}>
      {isLoggedin && (
        <CurrencySelector currency={currency} updateCurrency={updateCurrency} />
      )}
      {isLoggedin && <Navlink to="/favorites">Favs</Navlink>}
      {isLoggedin && (
        <Navlink to="/" onClick={() => setisLoggedin(false)}>
          Logout
        </Navlink>
      )}
    </nav>
  );
}

export default Navbar;
